import { Directive, ElementRef } from '@angular/core';

@Directive({
  selector: '[appHideNavbarDirective]'
})
export class HideNavbarDirectiveDirective {

  constructor(private el: ElementRef, private router) { 
    this.el.nativeElement.style.display = 'none';
  }

}
